  return (
    <div className='flex justify-between items-center sticky max-w-[1240px] p-8   px-4 background-color: transparent'>
      <h1 className='text-xl ml-2 font-bold '>Shopping</h1>
        <ul className='hidden md:flex'>
            <li className='ml-8 '>Products</li>
            <li className='ml-8'>Offers</li>
            <li className='ml-8'>Contact</li>
        </ul>

    </div>
  )
}

export default Navbar
